import React from "react";
import logosize from './images/DownloadApp.jpg';

import { useHistory } from "react-router-dom";

import {
  BrowserRouter as Router,
  Route,
  Switch,
  Link,
  withRouter,
  Redirect
} from "react-router-dom";

import {
    BoxFooter,
    ContainerFooter,
    RowFooter,
    ColumnFooter,
    HeadingFooter,
    ImgagingFooter
  } from "./FooterStyles";


function Footer() {
  return (
    <BoxFooter>
    <ContainerFooter>
    <RowFooter>
      <ColumnFooter>
       <ImgagingFooter src={logosize} alt="Download" />
      </ColumnFooter>
      <ColumnFooter>
        <HeadingFooter>
           Wander Wisely with the PalanetPnP app

        </HeadingFooter>
      </ColumnFooter>
    </RowFooter>
  </ContainerFooter>
  </BoxFooter>
  );
}

export default Footer;
